import Layout from '../components/Layout';
import Image from 'next/image';
import Link from 'next/link'; 
import { projectPage, projectImageGroup, projectImage, projectText } from '../styles.module.css';

const Projects = () => (
  <Layout>
    <div className={projectPage}>
      <h1>Projects</h1>
      <div className={projectImageGroup}>
        <div className={projectImage}>
          <Image
            alt="beHuman Logo"
            src="/beHumanLogo.png"
            layout="intrinsic"
            width={312}
            height={300}
          />
          <div>

          </div>
            <Link href="https://github.com/jillianlg">
              <h4>GitHub</h4>
            </Link>
       </div>
        <div className={projectImage}>
          <Image
            alt="AlcheZoomy Logo"
            src="/AlcheZoomy_Logo.png"
            layout="intrinsic"
            width={312}
            height={300}
          />
        </div>
        <div className={projectImage}>
          <Image
            alt="otNuevo Logo"
            src="/otNuevo.png"
            layout="intrinsic"
            width={312}
            height={300}
          />
        </div>
      </div>
    </div>
  </Layout>
  );

  export default Projects;
